/* General styling for stextbox boxes */
.custom-box {
    border-radius: 8px;
    padding: 15px 20px;
    margin: 20px 0;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
    position: relative;
    color: #333;
    background-color: #f8f9fa; /* Default light grey */
}

/* Box Caption Styling */
.box-caption {
    font-weight: bold;             color: #000; /* Black text */
    background-color: rgba(0, 0, 0, 0.1);
    padding: 8px 15px;
    border-radius: 5px 5px 0 0;
    margin: -15px -20px 10px -20px;
    font-size: 1.1em;
}

/* Box Color Variations */
.default { background-color: #f8d7da; } /* Light Red */
.default .box-caption { background-color: #f5c6cb; }

.download { background-color: #d1ecf1; } /* Light Blue */
.download .box-caption { background-color: #bee5eb; }

.info { background-color: #d4edda; } /* Light Green */
.info .box-caption { background-color: #c3e6cb; }

/* Content styling inside the box */
.box-content p {
    margin: 10px 0;
    font-size: 1em;
    font-style: italic;
    font-family: 'Georgia', serif;
}
